window.bookSummaryJSON = "<p><b>The Tutorial has progressed in unexpected ways as Jake is soon forced to confront reality....</b></p> <p>Jake has finally found a personal goal of his own as he gains a quest to defeat three more Beast Lords before he can face the final opponent of the Tutorial: The King of the Forest. Something he happily does, fully immersing himself in grasping power and gaining levels as he hunts through Dungeons to kill stronger and stronger foes.</p> <p>In another region of the Tutorial, turmoil amongst the humans quickly died down after a disastrous battle leaves nearly everyone except the Metal Mage William dead.</p> <p>Will Jake be able to hunt down the King of the Forest before the Tutorial ends? Does William wake up in time to create even more chaos and fulfill his goal of killing everyone? Who will survive till the end and return to Earth once more?</p> <p>Oh, and will Jake <i>ever </i>get a shirt that doesn’t get ripped apart in every single fight?</p> <p><b>Book two of the hit Primal Hunter LitRPG series by Zogarth. Grab your copy today and continue the adventure!</b></p> <p><b>About the series:</b> Experience an apocalypse LitRPG with levels, classes, professions, skills, dungeon, loot, and all of the great traits of progression fantasies and LitRPG that you have come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities as he grows in power and slowly transforms from a bored office worker to a true apex hunter. </p>"; 
